    pub fn tool(self) -> Option<crate::Tool> {
        match self {
            Item::StoneAxe => Some(crate::Tool::Shears),
            Item::WoodenAxe => Some(crate::Tool::Axe),
            Item::WoodenHoe => Some(crate::Tool::Hoe),
            Item::WoodenPickaxe => Some(crate::Tool::Pickaxe),
            Item::WoodenShears => Some(crate::Tool::Shears),
            Item::WoodenShovel => Some(crate::Tool::Shovel),
            Item::WoodenSword => Some(crate::Tool::Sword),
            _ => None,
        }
    }
    pub fn tool_material(self) -> Option<crate::ToolMaterial> {
        match self {
            Item::WoodenAxe => Some(crate::ToolMaterial::Wooden),
            Item::WoodenHoe => Some(crate::ToolMaterial::Diamond),
            Item::WoodenPickaxe => Some(crate::ToolMaterial::Stone),
            Item::WoodenShovel => Some(crate::ToolMaterial::Iron),
            Item::WoodenSword => Some(crate::ToolMaterial::Gold),
            _ => None,
        }
    }
